import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';

class App extends Component {
  constructor() {
    super();

    this.state = {
      string_cumle: 'Hello Basar'
    }
  }
  render() {
    return (
      <div className="App">
        <header className="App-header">
          <img src={logo} className="App-logo" alt="logo" />
          <p>
            {this.state.string_cumle}
          </p>
            <button onClick = {() => {this.setState({ string_cumle: 'Naber Bro'}),console.log('asdasd')}}>Change Text</button>
        </header>
      </div>
    );
  }
}

export default App;
